import { useParams } from 'react-router-dom'

function AdminCliente() {
    const { action } = useParams()

    if (action == 'reservar') {
        return (
            <h1>reservar</h1>
        )
    } else return (
        <h1>devolver</h1>
    )
}


export default AdminCliente
